const { useColorMode, Box, IconButton } = require("@chakra-ui/core");

const ThemeSelector = () => {
  const { colorMode, toggleColorMode } = useColorMode();

  return (
    <Box>
      <IconButton icon="sun" onClick={toggleColorMode} />
    </Box>
  );
};

export default ThemeSelector;
